const ImageModule = ({image, copy, link}) => {
  console.log(image)
  console.log(copy)
  return (
    <div>
      <img className={style.img} src={image} />
      <p className={style.copy}>{copy}</p>
      <a>{link}</a>
    </div>
  )
}
export default ImageModule
